import './report.scss';
import React, { useEffect, useState } from 'react';
import Layout from '../Layout';
import InnerLayout from '../components/Layout';
import { setWalletData } from 'app/shared/reducers/reports';
import { connect } from 'react-redux';
import { IRootState } from 'app/shared/reducers';
import { RouteComponentProps } from 'react-router-dom';
import Axios from 'axios';
import exportFromJSON from 'export-from-json';
import moment from 'moment';
import { isEmpty } from 'lodash';
import { useHistory } from 'react-router-dom';
import { useSelector } from 'react-redux';
// import {IRootState} from "app/shared/reducers"

export interface IWalletstProps extends StateProps, DispatchProps, RouteComponentProps<{}> {}

function report(props) {
  const [data, setData] = useState({
    start: '',
    end: '',
    accountNumber: '',
    accountOwnerName: '',
    schemeID: '',
    error: false,
    scheme: '',
  });
  const [schemes, setSchemes] = useState([]);
  const history = useHistory();
  const [format, setFormat] = useState('customer');

  const user = useSelector((state: IRootState) => state);

  // eslint-disable-next-line no-console
  console.log(user);

  const viewReport = () => {
    switch (format) {
      case 'trial':
        props.setWalletData(data);
        history.push('/wallets');
        return;
      case 'customer':
        // if(isEmpty(data.accountOwnerName)){
        //     alert("invalid account");
        //     return null;
        // }
        props.setWalletData(data);
        history.push('/mini-statement');
        return;
      case 'statement':
        props.setWalletData(data);
        history.push('/full-statement');
        return;
      case 'call':
        history.push({ pathname: '/callover', state: { start: data.start, end: data.end } });
        return;
      case 'scheme':
        props.setWalletData(data);
        history.push('/scheme-report');
        return;
      default:
        return false;
    }
  };
  const verifyUser = async accountNumber => {
    // setPageLoading(true)
    try {
      const theUser = await Axios.get(`api/wallet-accounts/avs/${accountNumber}`);
      console.error(theUser);
      setData({ ...data, accountNumber, accountOwnerName: theUser.data, error: false });
      //    const {firstName, lastName} = theUser.data.user;
      // setAdetails({accountName: theUser.data, e:true});
      // setPageLoading(false)
    } catch (error) {
      setData({ ...data, accountNumber, error: true });
      // setAdetails({accountName:'User not found!', e: false});
      // setPageLoading(false)
    }
  };

  const getSchemes = async () => {
    try {
      const theSchemes = await Axios.get(`api/schemes/admin/${props.userLog.login}`);
      console.error(theSchemes);
      setData({
        ...data,
        schemeID: theSchemes.data.data.length > 0 ? theSchemes.data.data[0].schemeID : '',
        scheme: theSchemes.data.data[0].scheme,
      });
      setSchemes(theSchemes.data.data);
    } catch (e) {
      console.error(e);
    }
  };

  useEffect(() => {
    console.error(props.userLog);

    getSchemes();
  }, []);
  const a = ['e', 'e'];
  return (
    <Layout>
      <InnerLayout dontfilter={true} show={true} title="Reports" path="Reports">
        <div style={{ minHeight: '60vh', display: 'flex', alignItems: 'center', flexDirection: 'column' }}>
          <select onChange={e => setFormat(e.target.value)} placeholder="select Report" className="select">
            <option value="customer">Customer Wallet of Statement</option>
            <option value="statement">Global Wallet Statement</option>
            <option value="trial">Global Trial Balance</option>
            {props.auth.includes('ROLE_ADMIN') && (
              <>
                <option value="log">Activity Log Report</option>
                <option value="audit">Audit Trail</option>
                <option value="call">Call Over Report</option>
                <option value="scheme">Scheme Customer Wallet Balance</option>
              </>
            )}
          </select>
          <div className="filtersection">
            <div>
              <p className="additional">Additional Search Required</p>
            </div>
            {
              <div style={{ flexDirection: 'column' }} className="dateRange">
                <select
                  onChange={e => {
                    // const toSave = e.target.value
                    // console.error(toSave);
                    setData({ ...data, schemeID: schemes[e.target.value].schemeID, scheme: schemes[e.target.value].scheme });
                  }}
                  placeholder="Enter The SchemeID *"
                  className="textinput"
                >
                  {schemes.map((s, i) => (
                    <option key={i} value={i}>
                      {s.scheme}
                    </option>
                  ))}
                </select>
                {/* {data.accountOwnerName && !data.error && <p style= {{backgroundColor:'#fff',  marginRight:'40px', fontSize: '12px', marginTop: '14px', padding: '10px', }}>{data.accountOwnerName}</p>}
                            {data.error && <p style= {{backgroundColor:'#fff', color: 'red',  marginRight:'40px', fontSize: '12px', marginTop: '14px', padding: '10px', }}>Invalid wallet Number</p>} */}
              </div>
            }
            {format !== 'scheme' && format !== 'trial' && (
              <div className="dateRange dt">
                <label className="dateLabel">
                  Start Date:
                  <input onChange={e => setData({ ...data, start: moment(e.target.value).format('YYYY-MM-DD') })} type="date" />
                </label>
                <label className="dateLabel">
                  End Date:
                  <input onChange={e => setData({ ...data, end: moment(e.target.value).format('YYYY-MM-DD') })} type="date" />
                </label>
              </div>
            )}
            {format === 'customer' && (
              <div style={{ flexDirection: 'column' }} className="dateRange">
                <input
                  value={data.accountNumber}
                  onChange={e => {
                    setData({ ...data, accountOwnerName: '', accountNumber: e.target.value });
                    if (e.target.value.length > 9) {
                      verifyUser(e.target.value);
                      return;
                    }
                  }}
                  placeholder="Enter Wallet Number *"
                  className="textinput"
                  type="text"
                />
                {data.accountOwnerName && !data.error && (
                  <p style={{ backgroundColor: '#fff', marginRight: '40px', fontSize: '12px', marginTop: '14px', padding: '10px' }}>
                    {data.accountOwnerName}
                  </p>
                )}
                {data.error && (
                  <p
                    style={{
                      backgroundColor: '#fff',
                      color: 'red',
                      marginRight: '40px',
                      fontSize: '12px',
                      marginTop: '14px',
                      padding: '10px',
                    }}
                  >
                    Invalid wallet Number
                  </p>
                )}
              </div>
            )}
            <div className="filter-action">
              {/* <select className = 'formatprint'>
                                <option>pdf</option>
                                <option>png</option>
                                <option>xls</option>
                                <option>html</option>
                            </select> */}
              <button onClick={viewReport} className="viewreport">
                View Report
              </button>
            </div>
          </div>
        </div>
      </InnerLayout>
    </Layout>
  );
}

const mapStateToProps = ({ reports, authentication: { isAuthenticated, account, sessionHasBeenFetched } }: IRootState) => ({
  data: reports.data,
  user: reports.user,
  auth: account.authorities,
  userLog: account,
});

const mapDispatchToProps = { setWalletData };

type StateProps = ReturnType<typeof mapStateToProps>;
type DispatchProps = typeof mapDispatchToProps;

export default connect(mapStateToProps, mapDispatchToProps)(report);
